<style>
#globe {
  width:550px;
  height:550px;
  /* transform: rotate(180deg);
  animation: rotation 60s infinite linear; */
}
#globe .st6,#globe .st8,#globe .st10,#globe .st12,#globe .st14,#globe .st17 {
	animation: shake_back 7s linear infinite;
  	-webkit-animation: shake_back 7s linear infinite;
}
#globe .st5,#globe .st7,#globe .st9,#globe .st11,#globe .st13,#globe .st15 {
	animation: shake 7s linear infinite;
  	-webkit-animation: shake 7s linear infinite;
}
#globe .st1 {
	animation: weeds 7s linear infinite;
  	-webkit-animation: weeds 7s linear infinite;
}
@media screen and (max-width:1024px) {
	#globe {
		width:450px;
		height:450px;
	}
}
@media screen and (max-width:992px) {
	#globe {
		width:275px;
		height:275px;
		margin-top:25px;
	}
}
@media screen and (max-width:767px) {
    #globe {
		width:350px;
		height:350px;
		max-width: 100%;
		margin-top:0;
	}
}
@keyframes rotation {
    0%{
        transform: rotate(0deg);

    }
    100%{
        transform: rotate(359deg);
    }

}

@-webkit-keyframes shake {
  0%, 100% {
  -webkit-transform: translate3d(0, 0, 0);
  transform: translate3d(0, 0, 0);
  animation-timing-function:ease-in-out;
  }
  10%, 30%, 50%, 70%, 90% {
  -webkit-transform: translate3d(0, 15px, 0);
  transform: translate3d(0, 15px, 0);
  animation-timing-function:ease-in-out;
  }
  20%, 40%, 60%, 80% {
  -webkit-transform: translate3d(0, -15px, 0);
  transform: translate3d(0, -15px, 0);
  animation-timing-function:ease-in-out;
  }
  }
  @keyframes shake {
  0%, 100% {
  -webkit-transform: translate3d(0, 0, 0);
  transform: translate3d(0, 0, 0);
  animation-timing-function:ease-in-out;
  }
  10%, 30%, 50%, 70%, 90% {
  -webkit-transform: translate3d(0, 15px, 0);
  transform: translate3d(0, 15px, 0);
  animation-timing-function:ease-in-out;
  }
  20%, 40%, 60%, 80% {
  -webkit-transform: translate3d(0, -15px, 0);
  transform: translate3d(0, -15px, 0);
  animation-timing-function:ease-in-out;
  }
  } 

@-webkit-keyframes shake_back {
  0%, 100% {
  -webkit-transform: translate3d(0, 0, 0);
  transform: translate3d(0, 0, 0);
  animation-timing-function:ease-in-out;
  }
  10%, 30%, 50%, 70%, 90% {
  -webkit-transform: translate3d(15px, 0, 0);
  transform: translate3d(15px, 0, 0);
  animation-timing-function:ease-in-out;
  }
  20%, 40%, 60%, 80% {
  -webkit-transform: translate3d(-15px, 0, 0);
  transform: translate3d(-15px, 0, 0);
  animation-timing-function:ease-in-out;
  }
  }
  @keyframes shake_back {
  0%, 100% {
  -webkit-transform: translate3d(0, 0, 0);
  transform: translate3d(0, 0, 0);
  animation-timing-function:ease-in-out;
